Teaching reading is a hugely complicated task. So much so that researcher Louisa Moats ended up entitling her influential article &#34;Teaching Reading IS Rocket Science.&#34; Watch and learn as Reading Rockets goes inside the classroom and captures effective techniques for teaching all aspects of Reading 101. The video clips are from Reading Rockets&#39; PBS television series Launching Young Readers.&#60;br&#62;
Launching Young Readers is designed for teachers, parents, caregivers, and anyone else interested in helping children learn to read. The programs feature the country&#39;s top reading experts, look at different reading strategies, provide practical advice for parents, and interweave the personal stories of children, families, and teachers.&#60;br&#62;
The following podcasts are available on ReadingRockets.org. For more information visit Reading Rockets&#39; Reading 101 section, where you&#39;ll find related videos, articles, and techniques for teaching reading effectively!

