Tuesdays at 11:00AM EST&#xD;
Wild Game Domain: From the Hunt to the Hearth focuses on the hunting, harvesting and sustainable consumption of wild game and forage found in our great nation. Host Chad Pagano discusses everything from the history of hunting to the recipes and techniques used to make healthy and  mouth watering dishes. The show also focuses on responsible hunting that supports the protection of wildlife. We&#x2019;ll cover questions such as  &#x201C;how does hunting relate to taxes?&#x201D; and &#x201C;what percentage of arrow costs go to wild game conservation?&#x201D; Tune in every Tuesday at 11:00AM and learn something new about one of the oldest human traditions.&#xD;
&#xD;
&#xD;
Having served in the United States Army's 10th Mountain Division Chef Chad Pagano used his recreational hunting skills to become a scout / sniper. After his service he enrolled in culinary school and found he had a affinity for natural, earthy and organic foods. He went on to work his way through the New York restaurant scene until he found his current position as a Chef Instructor at The Institute of Culinary Education. Chef Chad has appeared in many different media outlets to include the Food Network and NBC's Celebrity Apprentice. When outside the kitchen you will find Chad in the woods of upstate and Long Island New York hunting everything from deer and bear to turkey and ducks.

